INSERT INTO `MetaData` VALUES ('Percentage value is a comparison of 2050 emission target vs. actual 2005 emissions. Other developing countries includes smaller developing nations in the Middle East, Latin America, Africa, and Asia.','248','D_Pct change in Developing B FF emissions','Developing B countries emissions change','java.lang.Double','RANGE','Percentage of 2005 emissions','Fossil Fuel Emissions Change',NULL,'SCALAR',NULL),('Percentage value is a comparison of 2050 emission target vs. actual 2005 emissions. Developed countries includes many of the most developed nations: US, EU (27 countries), Norway and Sweden, Russia and the former Soviet States, Japan, Canada, South Korea, New Zealand, and Australia.','243','D_Pct change in Developed FF emissions','Developed countries emissions change','java.lang.Double','RANGE','Percentage of 2005 emissions','Fossil Fuel Emissions Change',NULL,'SCALAR',NULL),('Amount of emissions per year for developed countries including US, EU (27 countries), Russia and former Soviet States, Japan, Canada, South Korea, and Australia.','242','DevelopedFossilFuelEmissions','Developed Fossil Fuel Emissions','java.lang.Double','RANGE','10^9 tons','Fossil Fuel Emissions',NULL,'INDEXED','271'),('This value is a 0-to-1 index for the annual removal of CO2 from the atmosphere due to the creation of new forests, starting in 2009 and continuing until 2050. A value of 1 delivers the IPCC estimated maximum of 1.6 billion tons of carbon removed per year, while 0.5 delivers half of the maximum, and 0 means no increase.','244','D_Target Sequestration','Sequestration due to Treegrowth','java.lang.Double','RANGE','Fraction of max removal','Afforestation',NULL,'SCALAR',NULL),('This value is a measure of deforestation and resulting CO2 land use emissions. It value is a 0-to-1 index where a value of 1 yields constant emissions through 2050, 0.5 yields a drop of 45% by 2050, and 0 yields a 90% drop by 2050.','240','D_Global land use emissions change','Emissions from Deforestation','java.lang.Double','RANGE','Indexed fractional reduction','Deforestation',NULL,'SCALAR',NULL),('Amount of emissions per year for non-developed and non-developing countries.','246','DevelopingBFossilFuelEmissions','Other developing countries Fossil Fuel Emissions','java.lang.Double','RANGE','10^9 tons','Fossil Fuel Emissions',NULL,'INDEXED','271'),('Amount of emissions per year for developing countries including China, India, South Africa, Mexico, Brazil, and Indonesia.','245','DevelopingAFossilFuelEmissions','Rapidly developing countries Fossil Fuel Emissions','java.lang.Double','RANGE','10^9 tons','Fossil Fuel Emissions',NULL,'INDEXED','271'),('Percentage value is a comparison of 2050 emission target vs. actual 2005 emissions. Rapidly developing countries includes many of the fastest developing and larger nations: China, India, South Africa, Mexico, Brazil, Indonesia, and other large developing Asian countries.','247','D_Pct change in Developing A FF emissions','Developing A countries emissions change','java.lang.Double','RANGE','Percentage of 2005 emissions','Fossil Fuel Emissions Change',NULL,'SCALAR',NULL),('Concentration of CO2 in the atmosphere each year.','241','AtmosphericCO2Concentration','Atmospheric CO2 Concentration','java.lang.Double','RANGE','ppm','CO2 Concentration',NULL,'INDEXED','271'),('Change in mean global temperature (Celsius) each year, relative to pre-industrial temperatures.','263','GlobalTempChange','Global mean temperature change over preindustrial values','java.lang.Double','RANGE','C','Temperature Change (Degrees C)',NULL,'INDEXED','271'),('Simulation Year','271','Year','Simulation Year','java.lang.Integer','RANGE','Year','Year',NULL,'INDEX','271'),('Year at which other countries fossil fuel emissions reach target levels.','262','D_Developing B target year','Other developing countries target year','java.lang.Integer','RANGE','Year','Year',NULL,'SCALAR',NULL),('Year at which other countries fossil fuel emissions beg